class UniionFind:
    def __init__(self, grid):
        m, n = len(grid), len(grid[0])
        self.count = 0
        self.parent = [-1] * m * n
        self.rank = [0] * m * n
        for i in range(m):
            for j in range(n):
                if grid[i][j] == '1':
                    self.parent[i * n + j] = i * n + j
                    self.count += 1

    def find(self, p):
        if (p != self.parent[p]):
            self.parent[p] = self.find(self.parent[p])
        return self.parent[p]

    def isConnected(self, p, q):
        return self.find(p) == self.find(q)

    def union(self, p, q):
        proot = self.find(p)
        qroot = self.find(q)
        if proot == qroot:
            return
        if self.rank[proot] < self.rank[qroot]:
            self.parent[proot] = qroot
        elif self.rank[proot] > self.rank[qroot]:
            self.parent[qroot] = proot
        else:
            self.parent[qroot] = proot
            self.rank[proot] += 1
        self.count -= 1


class Solution2:
    def numIslands(self, grid) -> int:
        if not grid or not grid[0]:
            return 0
        self.dirs = [(0, 1), (0, -1), (-1, 0), (1, 0)]
        self.maxX = len(grid)
        self.maxY = len(grid[0])
        self.grid = grid
        self.visited = set()

        sum = 0
        for i in range(self.maxX):
            for j in range(self.maxY):
                sum += self.floodFillDFS(i, j)
        return sum

    def floodFillDFS(self, x, y) -> int:
        if not self.isValid(x, y):
            return 0
        self.visited.add((x, y))
        for k in self.dirs:
            self.floodFillDFS(x + k[0], y + k[1])
        return 1

    def isValid(self, x, y):
        if x < 0 or x >= self.maxX or y < 0 or y >= self.maxY:
            return False
        if self.grid[x][y] == '0' or ((x, y) in self.visited):
            return False
        return True


